$.getJSON("https:\/\/releases.admin.aspose.com/api/updatecount?path=f3f0463daa6e476eb45d62118a2c74a1&single=1", function(data) { $.each(data, function(key, value) {
$("#dwn-update-"+ key).css({"background":"none"});
$("#dwn-update-"+ key).css({"color":"#333"});
$("#dwn-update-"+ key).text(value.download_count);
$("#added-update-"+ key).text(value.date_added);
});
});

